import { API } from "../../../backend";



export const nowCooking = (user) => {
    return fetch(`${API}/admin/nowcooking/${orderId}`, {
        method: "GET",
        headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
        }
    }).then(res => {
        return res.json();
    }).catch(err => console.log(err));
}
